import React from 'react';
import styled from 'styled-components';



const Title = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;

const Wrapper = styled.section`
  padding: 4em;
  background: papayawhip;
`;

const Test = () => {
  return (
    <div>
      <Wrapper>
        <Title>Hello There!</Title>
      </Wrapper>
    </div>
  )
};

export default Test;

console.log(styled.h1);
